<script setup lang="ts">
import { ref } from "vue";
import BackgroundParticles from "./BackgroundParticles.vue";

const currentParticles = ref<"rain" | "snow" | "">("");

//Mobile colors
const frontMntMobile = ref("#44797D");
const backMntMobile = ref("#97B7BE");
const cloudsMobile = ref("white");
const skyTopMobile = ref("#2DD0DB");
const skyBotMobile = ref("#B0ECFF");

//Desktop colors
const frontMnt = ref("#44797D");
const backMnt = ref("#97B7BE");
const frontTrees = ref("#013F3A");
const backTrees = ref("#005250");
const upperLake = ref("#588588");
const lowerLake = ref("#5EA1AA");
const clouds = ref("white");
const skyTop = ref("#2DD0DB");
const skyBottom = ref("#FFFFFF");
const fog = ref(0);

const changeToDefault = () => {
  //Mobile colors
  frontMntMobile.value = "#44797D";
  backMntMobile.value = "#97B7BE";
  cloudsMobile.value = "white";
  skyTopMobile.value = "#049CCC";
  skyBotMobile.value = "#B0ECFF";

  //Desktop colors
  frontMnt.value = "#44797D";
  backMnt.value = "#97B7BE";
  frontTrees.value = "#013F3A";
  backTrees.value = "#005250";
  upperLake.value = "#588588";
  lowerLake.value = "#5EA1AA";
  clouds.value = "white";
  skyTop.value = "#8EF8FF";
  skyBottom.value = "white";

  currentParticles.value = "";
};

const changeToFoggy = () => {
  fog.value = 0.5;
};

const changeToCloudy = () => {
  //Mobile colors
  frontMntMobile.value = "#355964";
  backMntMobile.value = "#668086";
  cloudsMobile.value = "rgba(0, 0, 0, 0.0)";
  skyTopMobile.value = "#558FA1";
  skyBotMobile.value = "#D9EDFF";

  //Desktop colors
  frontMnt.value = "#355964";
  backMnt.value = "#668086";
  frontTrees.value = "#01343F";
  backTrees.value = "#03444D";
  upperLake.value = "#588588";
  lowerLake.value = "#5EA1AA";
  clouds.value = "rgba(0, 0, 0, 0)";
  skyTop.value = "#558FA1";
  skyBottom.value = "#D9EDFF";

  currentParticles.value = "";
};

const changeToRainy = () => {
  //Mobile colors
  frontMntMobile.value = "#366077";
  backMntMobile.value = "#3B6D88";
  cloudsMobile.value = "rgba(0, 0, 0, 0.0)";
  skyTopMobile.value = "#3A657B";
  skyBotMobile.value = "#568B94";

  //Desktop colors
  frontMnt.value = "#366077";
  backMnt.value = "#3B6D88";
  frontTrees.value = "#0B2321";
  backTrees.value = "#0C2D27";
  upperLake.value = "#2E4B5B";
  lowerLake.value = "#325A70";
  clouds.value = "rgba(0, 0, 0, 0)";
  skyTop.value = "#3A657B";
  skyBottom.value = "#568B94";
  fog.value = 0;

  currentParticles.value = "rain";
};

const changeToSnowy = () => {
  //Mobile colors
  frontMntMobile.value = "#9CC3EF";
  backMntMobile.value = "#94B9E3";
  cloudsMobile.value = "rgba(0, 0, 0, 0.0)";
  skyTopMobile.value = "#A1CDFF";
  skyBotMobile.value = "#D9EDFF";

  //Desktop colors
  frontMnt.value = "#9CC3EF";
  backMnt.value = "#94B9E3";
  frontTrees.value = "#31839E";
  backTrees.value = "#4C95AE";
  upperLake.value = "#A8CEF9";
  lowerLake.value = "#C7E7FF";
  clouds.value = "rgba(0, 0, 0, 0)";
  skyTop.value = "#A1CDFF";
  skyBottom.value = "#D9EDFF";

  currentParticles.value = "snow";
};

const handleUpdate = (id: number) => {
  if (id >= 200 && id <= 521) {
    changeToRainy();
  } else if (id >= 600 && id <= 622) {
    changeToSnowy();
  } else if (id >= 700 && id <= 781) {
    changeToFoggy();
  } else if (id >= 801 && id <= 804) {
    changeToCloudy();
  } else if (id === 800) {
    changeToDefault();
  }
};

defineExpose({
  handleUpdate,
});
</script>

